                    }}>
                        Browse authentic WWE merch, apparel, and fan gear built for true super-fans.
                    </p>
                    <button style={{
                        background: 'white',
                        color: '#c41e3a',
                        border: 'none',
                        padding: '12px 24px',
                        borderRadius: '4px',
                        cursor: 'pointer',
                        fontSize: '16px',
                        fontWeight: '600'
                    }}>
                        Shop Now
                    </button>
                </div>

                <div style={{
                    background: '#c41e3a',
                    padding: '30px',
                    borderRadius: '8px'
                }}>
                    <p style={{
                        margin: '0 0 10px 0',
                        fontSize: '14px',
                        fontWeight: '600',
                        opacity: '0.9'
                    }}>
                        EVENT PREVIEW FOR 7/6
